import React, { Component } from 'react';
import alterraLogo from './logoAlterra.png';
import profile from './profile.jpg';
import iconLoc from './ico-location.png';
import facebook from './ico-facebook.png';
import twitter from './ico-twitter.png';
import instagram from './ico-instagram.png';
import alterra from './logo-alterra-academy.png';


import iconGal from './ico-gallery@2x.png';
import jake from './jake-allison-1322894-unsplash.jpg';
import jay from './jay-lee-1323073-unsplash.jpg';
import ryan from './ryan-1321510-unsplash.jpg';
import nordwood from './nordwood-themes-1319985-unsplash.jpg';
import nic from './nic-yee-1321843-unsplash.jpg';
import phil from './phil-desforges-1322844-unsplash.jpg';


import Header from './header.js';
import Footer from './footer.js';
import Page1 from './page1.js';
import Page2 from './page2.js';
import Page3 from './page3.js';

import './App.css';
import './bootstrap.min.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">

        <div>
            <Header/>
            <Page1/>
            <Footer/>
            <Page2/>
            <Page3/>
        </div>


        </header>
      </div>
    );
  }
}

export default App;
